import React from 'react';
import imagenes from "../assets/imagenes";
import MenuActividades from '../componentes/MenuActividades';
import Navbar from "../componentes/MenuActividades";
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Campismo from './Campismo';
import Senderismo from "./Senderismo";
import Escalada from './Escalada';
import Rappel from './Rappel';
import Tirolesa from "./Tirolesa";
import Ciclismo from "./Ciclismo";
import Canonismo from "./Canonismo";
import Kayak from "./Kayak";

function Home() {
    return(
    <div>
        
          <h1 className="text-center">Home</h1>                    
          <img class="center" src={imagenes.img8}/>
          <h2 className="text-center" >Actividades</h2>
                
          <Navbar />
        
        
        

    </div>                               
                
  )      
  };


export default Home;

